import React, { useEffect, useState } from 'react';
import Axios from "axios";
import Header from './Header';
const App = () => {
  const [data, setData] = useState("");

  const getData = async() =>{
    const response = await Axios.get("http://localhost:3000/test");
    setData(response.data);
  }
  useEffect(() => {
    getData()
  }, []);

  return (
  <div>
    {data}
    <Header />
  </div>)
}

export default App;
